import { Link } from "react-router-dom";
import { useLogout } from "../hooks/useLogout";
import { useAuthContext } from "../hooks/useAuthContext";
const Navbar = () => {
  const { logout } = useLogout();
  const { user } = useAuthContext();

  const handleClick = () => {
    logout();
  };

  return (
    <>
      <nav className="navbar navbar-inverse">
        <div className="container-fluid">
          <div className="navbar-header">
            <img
              src="./dirty-deeds-auto-wash.png"
              alt="Logo"
              width="100px"
              height="100px"
            />

            <a className="navbar-brand">Dirty Deeds Auto Wash</a>
          </div>
          <ul className="nav navbar-nav justify-content-center">
            <li className="active">
              <Link to="/One">Home</Link>
            </li>
            <li>
              <Link to="/Two">Plans</Link>
            </li>
            <li>
              <Link to="/Three">About</Link>
            </li>
            <li>
              <Link to="/Four">Testimonials</Link>
            </li>
            <li>
              <Link to="/Five">Contact</Link>
            </li>
          </ul>
        </div>
        <div>
          {/* <span> {user.email}</span> */}

          <Link to="/Login">
            <button onClick={handleClick}>Log out</button>
          </Link>
        </div>
      </nav>
    </>
  );
};

